import React from "react";
import { useAuth0 } from "@auth0/auth0-react";
import Navbar from "./components/navbar"; // Nuevo componente Navbar
import "./App.css";

function App() {
  const { isAuthenticated } = useAuth0();

  return (
    <div className="App">
      {/* Navbar con funcionalidad de inicio de sesi√≥n */}
      <Navbar />

      <header className="App-header">
        <h1>Welcome to Taste Buddy!</h1>
        <p>
          {isAuthenticated
            ? "You're logged in. Enjoy your personalized experience!"
            : "Please log in to explore more features."}
        </p>
      </header>
    </div>
  );
}

export default App;
